let loader = document.querySelector(".loader")
console.log(loader)
if(loader){
const myTimeout = setTimeout(()=>{
    loader.style.transition = "1s all"
	loader.classList.add("visibility-hidden" , "opacity-0")
    loader.classList.add("!d-none")
}, 2300);}


var modal = document.getElementById("myModal");
var img = document.getElementById("myImg");
var modalImg = document.getElementById("img01");
if(img){
img.onclick = function(){
  modal.style.display = "block";
  modalImg.src = this.src;
       window.onclick = function(event) {
    if (event.target.id == "myModal") {
             modal.style.display = "none";
} 
}
}
}








$(document).ready(function() {
		  "use strict";
		  $('.menu > ul > li:has( > ul)').addClass('menu-dropdown-icon');
		  $('.menu > ul > li > ul:not(:has(ul))').addClass('normal-sub');
		  $(".menu > ul").before("<a href=\"#\" class=\"menu-mobile\"><img src='https://zorado.shop/wp-content/themes/zorado/assets/img/menu-2-line.svg' /></a>");
		  $(".menu > ul > li").hover(function(e) {
		    if ($(window).width() > 943) {
		      $(this).children("ul").stop(true, false).fadeToggle(150);
		      e.preventDefault();
		    }
		  });
		  $(".menu > ul > li").click(function() {
		    if ($(window).width() <= 943) {
		      $(this).children("ul").toggleClass('zir-menu');
		    }
		  });
		  $(".menu-mobile").click(function(e) {
		    $(".menu > ul").toggleClass('show-on-mobile');
		    e.preventDefault();
		  });
  
  
  		$(".menu-dropdown-icon").before().click(function(e) {
        $(this).before().toggleClass("mines-icon");
        })
  
		});





